import React, { useState } from 'react';
import './cart.css';

function Cart() {
    const[cart, setCart] = useState(true)

    const crossClickHandler = () => {
        setCart(!cart);
    }

  return (
    <>
    {
        cart &&
        <div className='cart_container'>
            <div className='cart_header'>
                <span onClick={crossClickHandler} className='icon'>&#10060;</span>
                <h2>Your Cart (2)</h2>
            </div>
        </div>
    }
    </>
  )
}

export default Cart
